type Deck struct {
	cards []int
	board []int
}

func newDeck(comb int) Deck {
	board := make([]int, comb)
	for i := range board {
		board[i] = i
	}
	if comb == 1 {
		board[0] = -1
	} else {
		board[comb-1] = board[comb-2]
	}

	return Deck{
		cards: []int{
			c2, d2, h2, s2,
			c3, d3, h3, s3,
			c4, d4, h4, s4,
			c5, d5, h5, s5,
			c6, d6, h6, s6,
			c7, d7, h7, s7,
			c8, d8, h8, s8,
			c9, d9, h9, s9,
			ct, dt, ht, st,
			cj, dj, hj, sj,
			cq, dq, hq, sq,
			ck, dk, hk, sk,
			ca, da, ha, sa,
		},
		board: board,
	}
}

func (d *Deck) remove(card int) {
	for i := range len(d.cards) {
		if d.cards[i] == card {
			d.cards[i] = d.cards[len(d.cards)-1]
			d.cards = d.cards[:len(d.cards)-1]
			return
		}
	}
}

func countup(limit int, list []int) bool {
	l := len(list)
	for i := l - 1; i >= 0; i-- {
		list[i]++
		if list[i] < limit-(l-1-i) {
			for j := i + 1; j < l; j++ {
				list[j] = list[j-1] + 1
			}
			return false
		}
	}
	return true
}

func (d *Deck) nextBoard(b []int) bool {
	if end := countup(len(d.cards), d.board); end {
		return end
	}

	for i, v := range d.board {
		b[i] = d.cards[v]
	}
	return false
}

